import 'svelte/internal/disclose-version';
import * as $ from 'svelte/internal/client';

export default function DecoratorHandler($$anchor, $$props) {
	$.push($$props, true);

	/*
	  Svelte Docgen will create argTypes for events with the name 'event_eventName'
	  The Actions addon will convert these to args because they are type: 'action'
	  We need to filter these args out so they are not passed to the component
	*/
	let propsWithoutDocgenEvents = $.derived(() => Object.fromEntries(Object.entries($$props.props).filter(([key]) => !key.startsWith('event_'))));

	var fragment = $.comment();
	var node = $.first_child(fragment);

	{
		var consequent = ($$anchor) => {
			var fragment_1 = $.comment();
			var node_1 = $.first_child(fragment_1);

			$.component(node_1, () => $$props.decorator.Component, ($$anchor, decorator_Component) => {
				decorator_Component($$anchor, $.spread_props(() => $$props.decorator.props, {
					children: ($$anchor, $$slotProps) => {
						var fragment_2 = $.comment();
						var node_2 = $.first_child(fragment_2);

						$.component(node_2, () => $$props.Component, ($$anchor, Component_1) => {
							Component_1($$anchor, $.spread_props(() => $.get(propsWithoutDocgenEvents)));
						});

						$.append($$anchor, fragment_2);
					},

					$$slots: { default: true }
				}));
			});

			$.append($$anchor, fragment_1);
		};

		var alternate = ($$anchor) => {
			var fragment_3 = $.comment();
			var node_3 = $.first_child(fragment_3);

			$.component(node_3, () => $$props.Component, ($$anchor, Component_2) => {
				Component_2($$anchor, $.spread_props(() => $.get(propsWithoutDocgenEvents)));
			});

			$.append($$anchor, fragment_3);
		};

		$.if(node, ($$render) => {
			if ($$props.decorator) $$render(consequent); else $$render(alternate, false);
		});
	}

	$.append($$anchor, fragment);
	$.pop();
}
